const styles = (theme) => ({
    rootTree: {
        display: 'flex',
        alignItems: 'center',
        marginRight: 0
    },
    labelCol: {
        flex: '0.8',
        fontWeight: 'inherit',
        flexGrow: 1,
        marginRight: '1.5rem'
    },
    lebelInfoCol: {
        flex: '0.5'
    },
    inputPropsRoot: {
        fontSize: theme.typography.pxToRem(12),
    
        '& > input': {
          paddingTop: '5.5px !important',
          paddingBottom: '5.5px !important',
        },
      },
});

export default styles;
